import React, { useState, useEffect } from "react";
import { Link, Navigate, NavLink } from "react-router-dom";
import { Button, Container, Grid, makeStyles } from "@material-ui/core";
import axios from "axios";
import Header from "./Header";
import "./bgstatic.css";

const useStyles = makeStyles((theme) => ({
  container: {
    paddingTop: theme.spacing(10),
  },
  image: {
    width: "100%",
    height: "auto",
  },
  button: {
    marginTop: theme.spacing(2),
  },
}));

const LandingPage = () => {
  const classes = useStyles();
  const [tokenn, setTokenn] = useState(localStorage.getItem("token"));

  if (!localStorage.getItem("token")) {
    return <Navigate to="/login" />;
  }

  return (
    <div>
      <Header />
      <div style={myStyle}>
        <Container className={classes.container}>
          <h1 className="large" style={{ color: "#30332E" }}>
            Welcome to Venture Hub
          </h1>
          <h3>A student activity website made by students for students.</h3>
          <Grid container spacing={3}>
            <Grid item xs={12} sm={6} md={4}>
              <img
                className={classes.image}
                src="https://www.svgrepo.com/show/5433/house.svg"
                alt="Roommates"
              />
              <Button
                className={classes.button}
                variant="outlined"
                color="primary"
                component={NavLink}
                to="/roommatesearch"
              >
                Browse for Roommates
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <img
                className={classes.image}
                src="https://cdni.iconscout.com/illustration/premium/thumb/events-4352689-3611150.png?f=webp"
                alt="Events"
              />
              <Button
                className={classes.button}
                variant="outlined"
                color="primary"
                component={NavLink}
                to="/eventsearch"
              >
                Discover Events
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <img
                className={classes.image}
                src="https://www.svgrepo.com/show/94674/books-stack-of-three.svg"
                alt="Textbooks"
              />
              <Button
                className={classes.button}
                variant="outlined"
                color="primary"
                component={NavLink}
                to="/textbooksearch"
              >
                Search or Buy Textbooks
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <img
                className={classes.image}
                src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/4c/Bus.svg/2560px-Bus.svg.png"
                alt="Bus Tickets"
              />
              <Button
                className={classes.button}
                variant="outlined"
                color="primary"
                href="http://localhost:8888"
                target="_blank"
              >
                Buy Bus Tickets
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <img
                className={classes.image}
                src="https://b.kisscc0.com/20180818/cie/kisscc0-meal-food-computer-icons-healthy-diet-plate-meal-plate-5b77a2727ae6b4.4534947215345670265034.png"
                alt="Meal Plan"
              />
              <Button
                className={classes.button}
                variant="outlined"
                color="primary"
                href="http://localhost:7777"
                target="_blank"
              >
                Buy a Meal Plan
              </Button>
            </Grid>
            <Grid item xs={12} sm={6} md={4}>
              <img
                className={classes.image}
                src="https://www.svgrepo.com/show/221188/elections-poll.svg"
                alt="Elections"
              />
              <Button
                className={classes.button}
                variant="outlined"
                color="primary"
                component={NavLink}
                to="/voting"
              >
                Elections! Vote Now!
              </Button>
            </Grid>
          </Grid>
        </Container>
      </div>
    </div>
  );
};

export default LandingPage;
